import * as React from "react";
import styled from "styled-components";
export const Nav = () => {
  return (
    <StyledWrapper>
      <nav class="navbar navbar-expand-lg navbar-light bg-light">
        <div class="container-fluid">
          <a class="navbar-brand" href="#">
            Navbar
          </a>
          <button
            class="navbar-toggler"
            type="button"
            data-bs-toggle="collapse"
            data-bs-target="#navbarSupportedContent"
            aria-controls="navbarSupportedContent"
            aria-expanded="false"
            aria-label="Toggle navigation"
          >
            <span class="navbar-toggler-icon"></span>
          </button>
          <div class="collapse navbar-collapse" id="navbarSupportedContent">
            <ul class="navbar-nav ml-auto"></ul>
          </div>
        </div>
      </nav>
    </StyledWrapper>
  );
};

//https://www.muscleandstrength.com/workouts/muscle-and-strength-womens-workout
//https://www.youtube.com/watch?v=dYjdzpZv5yc
//https://menubar.io/reactjs-tables
//https://www.youtube.com/watch?v=uduTSA_bkVY - make navbar to the right

const StyledWrapper = styled.div`
  .navbar {
    background-color: #e4f4fa;
    height: 40px;
    display: flex;
    justify-content: space-between;
  }
  .menu-items {
    display: flex;
  }
  .menu-items li {
    padding: 1rem;
    color: grey;
    font-size: 1.2rem;
    padding: 0.3rem;
  }

  .menu-items :hover {
    border-bottom: 2px solid #24f4fa;
  }
`;
